import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './Event.css';

export default function Event() {
  const [events, setEvents] = useState([]);
  const [editingEventId, setEditingEventId] = useState(null);
  const [editField, setEditField] = useState('');
  const [editValue, setEditValue] = useState('');

  // Fetch all events on component mount
  useEffect(() => {
    fetchEvents();
  }, []);

  const fetchEvents = async () => {
    try {
      const response = await axios.get('/getEvents');
      setEvents(response.data);
    } catch (error) {
      console.error('Error fetching events:', error);
    }
  };

  const updateEvent = async () => {
    let endpoint = '';

    switch (editField) {
      case 'date':
        endpoint = '/updateEventDate';
        break;
      case 'description':
        endpoint = '/updateEventDescription';
        break;
      case 'location':
        endpoint = '/updateEventLocation';
        break;
      default:
        console.error('Invalid edit field');
        return;
    }

    try {
      await axios.put(endpoint, { id: editingEventId, [editField]: editValue });
      fetchEvents(); // Refresh the events
      cancelEditing(); // Reset editing state
    } catch (error) {
      console.error(`Error updating event ${editField}:`, error);
    }
  };

  const deleteEvent = async (eventId) => {
    try {
      await axios.delete('/deleteEvent', { data: { id: eventId } });
      fetchEvents(); // Refresh the events list
    } catch (error) {
      console.error('Error deleting event:', error);
    }
  };

  const startEditing = (eventId, field, currentValue) => {
    setEditingEventId(eventId);
    setEditField(field);
    setEditValue(currentValue);
  };

  const cancelEditing = () => {
    setEditingEventId(null);
    setEditField('');
    setEditValue('');
  };

  return (
    <div className="event-page">
      <h1>Event Management</h1>

      <div className="event-list">
        {events.map((event) => (
          <div className="event-card" key={event.id}>
            <h2>{event.name}</h2>
            <p>
              <strong>Date:</strong> {event.date}{' '}
              {editingEventId === event.id && editField === 'date' ? (
                <input
                  type="date"
                  value={editValue}
                  onChange={(e) => setEditValue(e.target.value)}
                />
              ) : (
                <button
                  className="edit-button"
                  onClick={() => startEditing(event.id, 'date', event.date)}
                >
                  Edit
                </button>
              )}
            </p>
            <p>
              <strong>Location:</strong> {event.location}{' '}
              {editingEventId === event.id && editField === 'location' ? (
                <input
                  type="text"
                  value={editValue}
                  onChange={(e) => setEditValue(e.target.value)}
                />
              ) : (
                <button
                  className="edit-button"
                  onClick={() =>
                    startEditing(event.id, 'location', event.location)
                  }
                >
                  Edit
                </button>
              )}
            </p>
            <p>
              <strong>Description:</strong> {event.description}{' '}
              {editingEventId === event.id && editField === 'description' ? (
                <textarea
                  value={editValue}
                  onChange={(e) => setEditValue(e.target.value)}
                />
              ) : (
                <button
                  className="edit-button"
                  onClick={() =>
                    startEditing(event.id, 'description', event.description)
                  }
                >
                  Edit
                </button>
              )}
            </p>
            {editingEventId === event.id && (
              <div className="edit-actions">
                <button className="save-button" onClick={updateEvent}>
                  Save
                </button>
                <button className="cancel-button" onClick={cancelEditing}>
                  Cancel
                </button>
              </div>
            )}
            <button
              className="delete-button"
              onClick={() => deleteEvent(event.id)}
            >
              Delete Event
            </button>
          </div>
        ))}
      </div>
    </div>
  );
}
